import React from 'react'
import './NavBar.scss';

export default function NavBar() {
  return (
    <ul className="listItems">
        <li>
            <Link to="/">Accueil</Link>
        </li>
        <li>
            <Link to="/Ecrire">Ecrire</Link>
        </li>
        <li>
            <Link to="/Contact">Contact</Link>
        </li>
    </ul>
  );
}
